ataMart();\n\n// ==============================================\n\nfunction getCreateSqlForAllStaging() {\n\n  var query = \"\";\n  query += getCreateSqlForStagingPartial(getStagingTableName(\"_partial\"));\n  query += getCreateSqlForStaging(getStagingTableName(\"\"));\n\n  return query;\n}\n\nfunction getStagingTableName(postfix) {\n\n  var tableName = \"stg_cmis_\";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  tableName += \"_\" + getVariable(\"name\",\"\").replace(\":\", \"_\").trim();\n  if (tableName.length > parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length) {\n    var prefix = \"_\" + getVariable(\"id\",\"\").trim();\n    tableName = tableName.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length - prefix.length);\n    tableName += prefix;\n  }\n  tableName += postfix;\n\n  return tableName;\n}\n\nfunction getCreateSqlForStagingPartial(tableName) {\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS \" + tableName + \"; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += tableName + \" (\";\n  query += \"id int not null auto_increment, \";\n  query += \"alfresco_id smallint not null, \";\n  query += \"cmis_objectid varchar(255) not null, \";\n  query += \"cmis_name varchar(512) not null, \";\n  query += \"cmis_creationdate datetime not null, \";\n  query += \"cmis_lastmodificationdate datetime not null, \";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\') || getVariable(\"is_aspect\",\"\").equals(\'Y\')) {\n    query += \"cmis_contentstreamlength int not null, \";\n  }\n\n  // Fields.\n  for (var i=0; i < getInpu