,'id_connection',1,NULL),(9185,41,529,0,'sql',0,'select\n ${alfresco_id} as alfresco_id,\n \'Unknown\' as src_id,\n \'Unknown\' as \"name\",\n \'Unknown\' as title,\n \'Unknown\' as \"desc\",\n \'UNKNOWN\' as initiator,\n \'UNKNOWN\' as is_active,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as start_date_id,\n -1 as start_minute_id,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as due_date_id,\n -1 as due_minute_id,\n str_to_date(\'2000-01-01\',\'%Y-%m-%d\') as end_date_id,\n -1 as end_minute_id,\n 0 as duration,\n 0 as max_duration,\n \'Unknown\' as diagram_url,\n \'Unknown\' as definition_url,\n \'UNKNOWN\' as initiator_unknown,\n \'Unknown\' as definition_url_unknown\nunion all\nselect\n ${alfresco_id} as alfresco_id,\n stg_workflow_instances.id as src_id,\n stg_workflow_instances.name as \"name\",\n stg_workflow_instances.title as title,\n stg_workflow_instances.description as \"desc\",\n upper(stg_workflow_instances.initiator) as initiator,\n upper(stg_workflow_instances.isactive) as is_active,\n coalesce(date(stg_workflow_instances.startdate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as start_date_id,\n coalesce((extract(hour from stg_workflow_instances.startdate) * 60) + extract(minute from stg_workflow_instances.startdate),-1) as start_minute_id,\n coalesce(date(stg_workflow_instances.duedate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as due_date_id,\n coalesce((extract(hour from stg_workflow_instances.duedate) * 60) + extract(minute from stg_workflow_instances.duedate),-1) as due_minute_id,\n coalesce(date(stg_workflow_instances.enddate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as end_date_id,\n coalesce((extract(hour from stg_workflow_instances.enddate) * 60) + extract(minute from stg_workflow_instances.enddate),-1) as end_minute_id,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.enddate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as duration,\n round(coalesce(timediff(str_to_date(stg_wor